    function connectSIP(server, domain, username, password)
    {
        console.log("connectSIP", lynk.options);

        lynk.sip.sessions = {}
        lynk.sip.remoteAudioElements = {};

        var getTurnServers = function()
        {
            var turnServers = null;

            if (lynk.options.iceServers && lynk.options.iceServers.iceServers)
            {
                turnServers = [];

                for (var i=0; i<lynk.options.iceServers.iceServers.length; i++)
                {
                    if (lynk.options.iceServers.iceServers[i].url.indexOf("turn:") > -1 || lynk.options.iceServers.iceServers[i].url.indexOf("turns:") > -1)
                    {
                        turnServers.push({urls: lynk.options.iceServers.iceServers[i].url, username: lynk.options.iceServers.iceServers[i].username, password: lynk.options.iceServers.iceServers[i].credential})
                    }
                }
            }

            return turnServers;
        }

        var getStunServers = function()
        {
            var stunServers = null;

            if (lynk.options.iceServers && lynk.options.iceServers.iceServers)
            {
                stunServers = [];

                for (var i=0; i<lynk.options.iceServers.iceServers.length; i++)
                {
                    if (lynk.options.iceServers.iceServers[i].url.indexOf("stun:") > -1 || lynk.options.iceServers.iceServers[i].url.indexOf("stuns:") > -1)
                    {
                        stunServers.push(lynk.options.iceServers.iceServers[i].url)
                    }
                }
            }

            return stunServers;
        }

        lynk.sip.sipUI = new SIP.UA(
        {
            uri             : 'sip:default@' + lynk.options.hosts.sip,
            wsServers       : "wss://" + lynk.options.hosts.server + "/sip/proxy?url=ws://" + lynk.options.hosts.sip + ":5066",
            turnServers     : getTurnServers(),
            stunServers     : getStunServers(),
            registerExpires : 30,
            displayName     : lynk.options.nickName,
            traceSip        : true,
            log             : {
                level : 0,
            }
        });

        lynk.sip.sipUI.on('connected', function(e) {
            console.log("SIP Connected");
        });

        lynk.sip.sipUI.on('disconnected', function(e) {
            console.log("SIP Disconnected");
        });

        lynk.sip.sipUI.on('registered', function(e) {
            console.log("SIP Registered");
        });

        lynk.sip.sipUI.on('registrationFailed', function(e) {
            console.log("Error: Registration Failed");
        });

        lynk.sip.sipUI.on('unregistered', function(e) {
            console.log("Error: Unregistered");
        });

        lynk.sip.sipUI.on('message', function(message) {
            console.log("SIP Message", message.body);

            var data = {};

            if (message.body.substring(0, 1) == "{")
            {
                try {
                    data = JSON.parse(message.body);

                    console.log("JSON Object", data);

                } catch (e) {
                    console.error(e);
                }
            }
        });
    }

    function dial(name)
    {
        console.log("dial", name);

        var setupRemoteAudio = function(name)
        {
            console.log("setupRemoteAudio!", name);

            var id = "remoteAudio-sip-" + name;
            var audio = document.getElementById(id);

            if (!audio)
            {
                audio = new Audio();
                audio.id = id;
                audio.controls = false;
                audio.autoplay = true;
                audio.muted = false;
                audio.volume = 1;
                document.body.appendChild(audio);
            }

            lynk.sip.remoteAudioElements[name] = audio;
            return audio;
        }

        try {

            lynk.sip.sessions[name] = lynk.sip.sipUI.invite(name,
            {
                media : {
                    stream      : lynk.localAudioTracks[name].stream,
                    constraints : { audio : true, video : false },
                    render      : { remote : setupRemoteAudio(name)},
                },
                extraHeaders: [ 'X-ofmeet-userid: ' + lynkUI.username, 'X-ofmeet-room: ' + name ]
            });

            lynk.sip.sessions[name].direction = 'outgoing';
            lynk.sip.sessions[name].sessionId  = Math.random().toString(36).substr(2, 9);

        } catch(e) {
            console.error("dial failed", e);
        }
    }

